import { SocialEnums } from "./enum";

export const getDisplayAddress = (
  address: string | null | undefined
): string => {
  if (!address) {
    return "";
  } else {
    return `${address.toString().slice(0, 4)}...${address
      .toString()
      .slice(-4)}`;
  }
};

